  \"NODC Standard Product: World Ocean Circulation Experiment (WOCE) global data,
  version 3.0, 2002 (2 disc set) (NODC Accession 0000841)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:42.109222\",\n\t\"name\": \"nodc-standard-product-world-ocean-circulation-experiment-woce-global-data-version-3-0-2002\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The World Ocean Circulation Experiment
  (WOCE) was a part of the World Climate Research Programme (WCRP) which used resources
  from nearly 30 countries to make unprecedented in-situ and satellite observations
  of the global ocean between 1990-1998, and to observe poorly-understood but important
  physical processes. The Scientific Steering Group (SSG) of WOCE oversaw the scientific
  development and the International Project Office (IPO) managed the implementation
  of the Experiment.The WOCE Global Data DVD suite consists of two single-sided and
  double-layered DVDs. A Web browser is required to fully explore and access the DVD
  contents. Data on these disks cover most of the global ocean and are from the period
  of 1990 to 1998, the intensive observation phase of WOCE. Some data from before
  and after this period are also included.The WOCE data streams were: Bathymetry,
  Current Meters, Drifters, Hydrography, In-Situ Sea Level-Fast Delivery, In-Situ
  Seal Level-Delayed Mode, Profiling Floats, Satellite Sea Surface Height, Satellite
  Sea Surface Temperature, Satellite Surface Winds, Sea Surface Salinity, Shipboard
  Acoustic Doppler Current Profilers, Subsurface Floats, Surface Meteorology, and
  Upper Ocean Thermal.Presentations given during the WOCE and Beyond Conference are
  archived with this DVD prodcut, but are not part of the two DVD set.\",\n\t\"license_title\":
